description:
Here I am house sitting for a very good friend of mine. She's also left her teenage daughter with me to take care of. I was about to head out to run some errands when I realized I had to return home for something I had forgotten. That's when I heard moaning coming from the bedroom. These teenagers were fucking! I took the initiative and broke it up. I made a deal with them, I would not tell if they did as I said. They had no idea what they were doing. So, I became an instructor of sorts. Showing them how it's done. In the end I believe they learned a few valuable things that will be useful going into adulthood. 


